Defendant Cyle Ann Kraft in court with attorney Jamie F Cimpl-Wiemer.  Defendant Cyle Ann Kraft in custody.  Jay R Pucek appeared for the State of Wisconsin.  Defendant was advised of constitutional rights and maximum penalties, and further advised that if not a United States citizen deportation is possible. Defendant sworn, examined as to plea, and entered a plea of guilty.  Court found defendant freely, voluntarily and intelligently waived all constitutional rights. Plea questionnaire waiver of rights and addendum to plea questionnaire received and filed. Parties stipulated to the criminal complaint as factual basis to sustain defendant's plea. Court found defendant guilty as charged in the Information and ordered a Judgment of Conviction be entered into the record.  The Court advised defendant that as a convicted felon not to possess any firearms.   Court further advised defendant of voting ineligibility.   

Sentencing proceeded.  Statements by the State, defense and defendant.  The Court imposed the following sentence:
Defendant's TOTAL LENGTH OF SENTENCE shall be 5 years consecutive to any other sentence.  Defendant's TERM OF CONFINEMENT in the Wisconsin Prison System shall be for 30 months.  Defendant shall serve 30 months on EXTENDED SUPERVISION.    

The defendant IS eligible for the Challenge Incarceration Program, and for the Wisconsin Substance Abuse Program.  The Court advised the defendant of her determinate sentence pursuant to statute and in accordance with Form CR-234.  Copy provided to defendant. 
 * Court ordered defendant to provide a DNA sample.
 * Court ordered a 24 month driver's license revocation and 24 month ignition interlock.
 * Court ordered defendant to complete a driver assessment and safety plan; order signed and filed; copy provided to defendant.
 * Court ordered defendant to pay a $600 fine, plus DNA surcharge, costs and disbursements.  Defendant given three years to pay; to be paid while on probation.  Should defendant get revoked, monies are ordered taken from prison funds not to exceed 25%. 

The Court STAYED THE PRISON SENTENCE and placed the defendant on probation to the State Department of Corrections for a period of three (3) years.

CONDITIONS OF PROBATION (and Extended Supervision, if revoked):
 - Serve 6 months condition time at the House of Correction, consecutive to time ordered in 13CT2382 and 14CT511. Court allowed release to the Day Reporting Center (DRC).
 - AODA assessment and treatment;
 - No controlled substances other than those legally prescribed for defendant by a duly licensed physician for her mental or physical needs and only as long as deemed medically necessary;
 - No alcohol;
 - Urine screens;
 - Seek and maintain employment;
 - Job and vocational training;
 - Pay balance remaining of the fine, costs, surcharges and disbursements.  Failure to pay amounts in full would result in a civil judgment entered against defendant which is non-dischargable in bankruptcy.

